import React from "react";

import { NavLink } from "react-router-dom";

const Subnav= () =>{
    




    return (
        <>
            <div>
            <li> <NavLink exact activeClassName='active_class' to= '/qualification' >Graduation</NavLink></li>
        <li> <NavLink exact activeClassName='active_class' to= '/habbits' >Habbits</NavLink></li>
        <li> <NavLink exact activeClassName='active_class' to= '/personal' >personalinfo</NavLink></li>
                
            </div>
        </>
    )
}
export default Subnav;
